import React from 'react';
import './App.css';
import {Route, Link} from 'react-router-dom'


const HomePage = (props) => {
  console.log(props);
   return(
     <div>
      <button onClick={() => props.history.push('/products')}>Products</button>
      <h1>HOMEPAGE</h1>
     </div>
   );
};

const ProductsList = props => {
   return(
     <div>
      <h1>Products List Page</h1>
      <Link to={`{props.match.url}`}></Link>
     </div>
   );
};

const ProductsDetail = props => {
   return(
     <div>
      <h1>Products Detail Page: {props.match.params.productId}</h1>
     </div>
   );
};



function App() {
  return (
      <div>
        <Route path='/' component={HomePage}/>
        <Route path='/bicycles' component={ProductsList}/>
        <Route path='/products/:productId' component={ProductsDetail}/>
      </div>
  );
}

export default App;
